Aile.create(modele: 'Bandit 5', marque_id: 2, annee: 2012, note: 4, vote: '12', description: %Q[ Depuis la première Bandit l'objectif de F-one est de proposer une aile unique, performante dans chaque discipline et style de rider, du débutant au compétiteur. En matière de R&D être performant dans tous les domaines se révèle bien plus complexe que de développer plusieurs modèles d'ailes très spécifiques. L'autre défi difficile à relever pour la Bandit 5 était d'améliorer la Bandit 4, sans perdre aucune de ses qualités. Parce que se dépasser soi même est une course qui ne fini jamais. Un nouveau type de profil plus plat a donc été retenu, plus facile a choquer pour garder le contrôle dans la plage haute et qui tolère mieux d’être bordé en plage basse, ce qui offre une puissance constamment disponible. La pression de barre a été justement dosée pour que le pilotage ne soit pas trop physique. La B5 procure une pression plus importante dans le harnais tous en soulageant les bras. La barre reste idéalement présente pour retransmettre l’ensemble des informations nécessaires. ], score_relaunch: 9.0, score_highwind: 6.0, score_lowwind: 10.0, score_easyofuse: 8.0, score_wave: 10.0, score_unhooked: 5.0 ,url_flysurf: '' ,url_vagueetvent: '' ,url_freerideattitude: '', tags: '4 lignes,Allround,Delta', test_link: %Q[FR;Test du forum Kite-Spirit;http://www.kite-spirit.com/forum/viewtopic.php?id=2211
