Aile.create(modele: 'Bandit 6', marque_id: 2, annee: 2013, note: 5, vote: '14', description: %Q[La Bandit est l’aile de référence de la marque. Caractérisé par son Delta C Shape, la Bandit a su au cours des années s’affirmer comme modèle de référence dans de nombreuses disciplines du kitesurf (freestyle, freeride, Waveriding)
Pour permettre d’ajuster au mieux les qualités à la demande des pratiquants, les évolutions cette année ont essentiellement portées sur 2 éléments clés du développement de la 6e édition.

Tous d’abord, de gros progrès sont apportés concernant la plage d’utilisation de l’aile.
Celle-ci est désormais plus large et a pour résultat d’améliorer sécurité et confort de navigation.
La Bandit 6 conserve tout de même sa force ascensionnelle pour le highjump et les kiteloop, ainsi que sa puissance légendaire en plage basse.

Deuxième élément clé, FONE s’est centré sur le ressenti en terme de navigation et notamment concernant la sensation de légèreté. En effet, la légèreté est une qualité principale pour améliorer les sensations, c’est la raison pour laquelle F-One a travaillé pour améliorer la réactivité et le dynamisme de l’aile.
Pour cette 6e édition de la Bandit, F-One a encore réussi un très beau défi, améliorer les sensations de navigation sans pour autant compromettre les qualités des générations précédentes.], score_relaunch: 8.5, score_highwind: 7.0, score_lowwind: 10.0, score_easyofuse: 10.0, score_wave: 9.0, score_unhooked: 7.0 ,url_flysurf: 'http://www.flysurf.com/ficheproduit-aile-f-one-bandit-6-2013-nue.htm?sectionid=25&productid=3723&variationid=8569' ,url_vagueetvent: '6;http://www.vagueetvent.com/6,0,f,one,bandit6,aile,kite,nue,2013-150911-40201.html
