Aile.create(modele: 'Vegas', marque_id: 3, annee: 2013, note: 4, vote: '14', description: %Q[Cette année, la Vegas 2013 à subit de nombreuses modifications et cela se voit clairement des le premier coup d'oeil.

Nous avons donc les lattes qui sont descendues plus loin sur les oreilles ce qui a pour principal effet d'augmenter la plage basse, ce rapprochement des lattes sur les oreilles augmente la rigidité de l'aile la rendant par la meme occasion plus vive et plus reactive avec un feeling en barre des plus direct !
Ces modifications permettent de creer une vegas encore plus performante, poussant la notion de Freestyle encore un cran plus loin (et les loops sont .... puissants ) !
Mais attention, la vegas ne renie aucunement ses origines et sa lignée, en restant toujours aussi polyvalente et accessible , on pourrait la mettre dans les mains d'un debutant sans problemes !

Avec ses deux reglages sur les avants, donnant au choix un gros depower, du lift et une grande reactivité sur le reglage freestyle ou alors moins de depower, plus de pop et plus de tolerance aux erreurs de barres sur le reglage Wakestyle tout en restant suffisamment vive !], score_relaunch: 6.5, score_highwind: 10.0, score_lowwind: 6.5, score_easyofuse: 10.0, score_wave: 7.0, score_unhooked: 10.0 ,url_flysurf: 'http://www.flysurf.com/ficheproduit-aile-north-vegas-2013-nue.htm?sectionid=25&productid=3529' ,url_vagueetvent: '6;http://www.vagueetvent.com/6,0,north,vegas,aile,kite,2013,nue-141365-40201.html
