Aile.create(modele: 'Evo', marque_id: 3, annee: 2013, note: 5, vote: '16', description: %Q[Machine à tout faire ultime, la evo de north Kiteboarding est la voile à posséder si tu changes de style de ride aussi souvent que tu changes de fringues !

Cette année, la evo incorpore à ses extrémités le design progressif «adaptive tips» ainsi que le système de profilage des lattes 'Streamline' ; ces nouvelles lattes permettent de bien mieux contrôler l’écoulement du flux d’air sur le kite. cela signifie qu'il est possible d'améliorer la vitesse de rotation et la réactivité du kite et offrir ainsi au rider une sensation en barre beaucoup plus vivante.
Les tailles les plus grandes ont un profil accru ce qui donne à l'aile une bien meilleur plage basse et un départ au planing plus progressif,  la evo peut être ridée en 4 ou 5 lignes permettant au rider d’utiliser l’aile comme il lui convient. le depower est excellent et l’aile tourne de manière directe et réactive, permettant au rider de toujours savoir d’instinct où se trouve l’aile dans la fenêtre de vol. la evo ne tardera pas à cesser d’être un kite pour devenir une extension de tes bras ! hooké, déhooké, freestyle, freeride, dans de petites vagues ou un swell énorme, avec ou sans straps, une chose est sûr : la evo sera toujours là pour t’éclater !], score_relaunch: 10.0, score_highwind: 7.0, score_lowwind: 9.0, score_easyofuse: 10.0, score_wave: 8.0, score_unhooked: 7.0 ,url_flysurf: 'http://www.flysurf.com/ficheproduit-aile-north-evo-2013-nue.htm?sectionid=25&productid=3974' ,url_vagueetvent: '5;http://www.vagueetvent.com/5,0,north,evo,nue,aile,kite,2013-153829-40201.html
