Aile.create(modele: 'Fuse', marque_id: 3, annee: 2013, note: 4, vote: '14', description: %Q[Il y a quatre ans nous avons entrepris de concevoir notre premier kite dédié 4-lignes: la Fuse était née et nous ne l’avons pas regretté. 
A l’origine la Fuse était similaire en design à la Rebel avec un simple bridage 4-lignes. 
Nous avons travaillé d’arrache pieds pour être sûr d’avoir trouvé le bridage optimal et nous l’avons peaufiné et ajusté au fil des années pour obtenir le meilleur de ce kite et les résultats parlent d’eux-même. La 14, 16 et la 18 disposent d’une des meilleures plages basses de notre gamme qui est en grande partie due au système de bridage qui permet un réglage du kite à la perfection. 
C’est un kite hybride typé freeride/vagues qui impressionnera tous ceux qui l’essaieront! Les sauts et la sustentation sont excellents et le pilotage en barre direct et réactif, le bridage offre au kite un excellent depower et une plage d’utilisation très large. 
Quant à la remontée au vent, elle est impressionnante. Le design réactif des extrémités, couplé au profilage des lattes, donne au kite une bien meilleure stabilité en l’air et améliore la réponse en barre et la vitesse du kite dans les courbes. 
Gonfle le, serre ton harnais et prépare toi au décollage !], score_relaunch: 8.0, score_highwind: 8.0, score_lowwind: 9.0, score_easyofuse: 10.0, score_wave: 8.0, score_unhooked: 7.0 ,url_flysurf: '' ,url_vagueetvent: '' ,url_freerideattitude: '', tags: '4/5 lignes,Allround,Hybride', test_link: %Q[])
Aile.create(modele: 'Rebel', marque_id: 3, annee: 2013, note: 3, vote: '15', description: %Q[La Rebel reste le kite le plus performant de la gamme north tant pour aller tater de la bonne vague que pour se tailler des grands bord en freeride.
La rebel est l'une des ailes les plus vendues et plesbiscitée par les riders partout dans le monde !
Cette aile est conviendra à tout les riders 'hookés' que vous souhaitiez vous satelliser avec de gros jumps, charger de la grosse vague, vous balader tranquillement ou plus simplement tout cela à la fois (eh oui pourquoi se limiter à un seul de ces plaisirs ?) la rebel 2013 est donc faite pour vous !
Reprenant le shape du modele 2012, un enorme travail à été effectué sur les lattes, le resultat : des lattes de plus gros diametre à la base et plus fine au niveau du bord de fuite afin de produire une aile plus confortable et efficace en plage basse tout en la rendant plus reactive pour le declenchement des virages.
Elle devient ainsi encore plus redoutable en vague ou sa reactivité, sa puissance intuitive et sa capacité à reculer dans la fenetre font de miracles !
La canopy à été 'aplatie' au niveau des oreilles permettant principalement une meilleure tenue en plage haute mais aussi une reduction de la trainée apportant plus de stabilité dans les vents rafaleux.], score_relaunch: 8.0, score_highwind: 7.5, score_lowwind: 7.0, score_easyofuse: 9.5, score_wave: 8.0, score_unhooked: 6.0 ,url_flysurf: 'http://www.flysurf.com/ficheproduit-aile-north-rebel-2013-nue.htm?sectionid=25&productid=3505&variationid=7950' ,url_vagueetvent: '5;http://www.vagueetvent.com/5,0,north,rebel,aile,kite,2013,nue-141359-40201.html
