Aile.create(modele: 'Evo', marque_id: 3, annee: 2012, note: 5, vote: '15', description: %Q[La North Evo 2012 est très probablement l'aile la plus polyvalente de la gamme North, un kite multi usage aussi à l’aise en surf dans les vagues que dans des manoeuvres déhookés en freestyle new-school. Un développement de la puissance doux et prévisible allié à un retour en barre constant de type aile C-Shape sont autant d’invitations à vous déhooker pour balancer des tricks new-school ou envoyer des kites loops massifs ou des gros jumps. Avec son depower efficace, sa rapidité à tourner et sa capacité à avancer au vent, elle comblera aussi les adeptes du surf et des vagues. Peu importe les caprices d’Eole et Neptune, avec la EVO tu seras toujours prêt à profiter au mieux de n’importe quelles conditions. Envoyer du bois en freestyle, déchirer les vagues, hang-time ou cruising tranquille ou tout ça à la fois avec la EVO tu es paré, plaisir et performance avant tout.], score_relaunch: 9.0, score_highwind: 7.0, score_lowwind: 9.0, score_easyofuse: 9.0, score_wave: 8.0, score_unhooked: 7.0 ,url_flysurf: '' ,url_vagueetvent: '' ,url_freerideattitude: '', tags: '4/5 lignes,Allround,Delta', test_link: %Q[])
Aile.create(modele: 'Vegas', marque_id: 3, annee: 2012, note: 4, vote: '11', description: %Q[La Vegas 2012 confirme sa longue tradition de kite C-Shape outrageusement polyvalent en intégrant des caractéristiques new-school/wake sans compromis avec le confort d’une aile free-ride.Cette polyvalence s’obtient simplement en changeant les points de connexion aux extrémités du kite. La Vegas propose trois réglages différents accessibles en changeant simplement de noeud. Ces réglages ont été optimisés pour offrir trois modes bien distincts en fonction de votre style de navigation préférée. Le réglage freeride standard offre tout ce que vous êtes en droit d’attendre d’un kite free-ride avec beaucoup de depower, une barre réactive et une voile au comportement prévisible. Le second réglage est idéal pour faire ses premiers pas en freestyle : une pression en barre plus dure pour un retour en barre de la position de l’aile plus précis et aussi une barre moins réactive pour envoyer des tricks unhooked. La troisième option transforme la Vegas en une pure machine wake /new school avec une assise bien basse dans la fenêtre de vent et qui délivre une traction constante avec un border/choquer très limité. C’est le réglage de prédilection de nos riders freestyle hardcore qui autorise des kiteloops puissants et délivre un gros pop pour tous les tricks new-school aile basse et wakestyle.], score_relaunch: 6.0, score_highwind: 9.0, score_lowwind: 6.0, score_easyofuse: 10.0, score_wave: 7.0, score_unhooked: 9.0 ,url_flysurf: '' ,url_vagueetvent: '' ,url_freerideattitude: '', tags: '5 lignes,Wakestyle,C-kite', test_link: %Q[])
