Aile.create(modele: 'Fuse', marque_id: 3, annee: 2012, note: 4, vote: '13', description: %Q[La North Fuse 2012 est la dernière création du team de recherche et dévelopement North. Un kite dédié au freeride et aux vagues qui annonce le future du 4 lignes performance. La Fuse est une aile nouvelle génération de freeride, vagues avec une plage d’utilisation énorme. Sécurisante et prévisible la Fuse est légère en barre avec un maximum de sensation et un excellent pouvoir ascensionnel. Le nouveau bridage Attack Control Bridle simple et unique rend la Fuse très maniable, en particulier lorsque la voile est choquée. C’est un grand pas en avant en termes de maniabilité et réactivité en 4 lignes. Le depower est excellent grace au nouveau bridage AC Bridle qui permet aussi d’amener la Fuse en position neutre sur le dos comme pour les systèmes 5 lignes. La plage basse de l’aile est facilement accessible et la résistance extrême de la Fuse au phénomène d’inversion ( backstall ) la rend très performante dans le petit temps. En plage haute, le bridage AC Bridle assure un de-power direct et un pilotage précis avec un développement de puissance par bordé choqué très instinctif. La Fuse a été construite pour durer en utilisant la nouvelle toile Technoforce D2 exclusive de North, beaucoup plus résistante au déchirement et au vieillissement que la toile traditionnelle.
La simplicité du système de gonflage à point unique Lazy Pump permet d’être rapidement sur l’eau quand il le faut. Pour assurer une solution sécurité à 100 % la Fuse peut aussi se naviguer en mode 5 ligne si désiré.], score_relaunch: 8.0, score_highwind: 7.0, score_lowwind: 8.0, score_easyofuse: 10.0, score_wave: 8.0, score_unhooked: 6.0 ,url_flysurf: '' ,url_vagueetvent: '10;http://www.vagueetvent.com/10,0,north,fuse,kite,nue,2012-123912-40201.html' ,url_freerideattitude: '', tags: '4/5 lignes,Freeride,Allround,Hybride', test_link: %Q[])
Aile.create(modele: 'Neo', marque_id: 3, annee: 2012, note: 4, vote: '13', description: %Q[La North Kite NEO est une aile de kite freeride polyvalent qui combine une traction douce et progressive comme la EVO et la simplicité d’une construction 3 lattes dans un pack polyvalent stylé et évolutif. Son profil étroit et rond ainsi que sa capacité de rotation fluide en font l’arme idéale pour des kites loops serrés et compacts. Très légère grâce à ses trois lattes effilées, la Neo est particulièrement ludique et jouissive grâce à sa capacité à reculer dans la fenêtre lors du surf. La Neo se navigue en mode 4 ou 5 lignes et reste le jouet idéal pour progresser en sortie de stage et sa facilité d’utilisation séduira aussi les riders qui aiment la simplicité et les ailes dociles. Super résistante, construite avec nos matériaux haut de gamme et la qualité de construction North, la Neo est faite pour durer.], score_relaunch: 8.0, score_highwind: 9.0, score_lowwind: 7.0, score_easyofuse: 9.0, score_wave: 10.0, score_unhooked: 7.0 ,url_flysurf: '' ,url_vagueetvent: '' ,url_freerideattitude: '', tags: '4/5 lignes,Allround,Hybride', test_link: %Q[])
Aile.create(modele: 'Neo', marque_id: 3, annee: 2013, note: 4, vote: '14', description: %Q[La Neo a été introduite dans la gamme North Kiteboarding en 2012 et c’est l’arme de choix de nos riders de vagues hardcore. 
La Neo a un design simple 3 lattes qui offre une réactivité cinglante, une facilité d’utilisation et un développement de la puissance fluide tout au long de l’arc de rotation de l’aile. Comme nous n’utilisons que 3 lattes, la Neo est incroyablement légère, ce qui signifie qu’elle 'drifte', qu’elle descend au vent lorsque tu descends d’une vague et te permet de te concentrer sur le tube de grâce à sa capacité à reculer dans la fenêtre lors du surf. 
La Neo se cale un peu en retrait dans la fenêtre de vol ce qui lui permet de 'drifter' c’est à dire de descendre au vent au lieu de voler en arrière. Cela signifie aussi que l’aile fonctionne bien lorsqu’elle est choquée : le contrôle du pilotage est maintenu et le comportement vivant du kite n’est pas perdu lorsque l’aile atteint leslimites supérieures de sa plage de vent. 
La Neo marche aussi parfaitement bien déhooké et s’adaptera donc à n’importe quel style de ride de waveriding. Et si les vagues ne sont pas au rendez-vous, pas de soucis ! L’aile peut aussi être utilisée pour le freestyle et son pilotage réactif, son développement de puissance progressif et sa facilité à redécoller en font un kite parfait pour apprendre de nouveaux tricks. 
Si c’est un kite pour déchirer les vagues que tu cherches alors n’acceptes pas les imitations: c’est la Neo qu’il te faut !], score_relaunch: 9.0, score_highwind: 9.0, score_lowwind: 6.0, score_easyofuse: 10.0, score_wave: 10.0, score_unhooked: 7.5 ,url_flysurf: 'http://www.flysurf.com/ficheproduit-aile-north-neo-2013-nue.htm?sectionid=25&productid=4730' ,url_vagueetvent: '6;http://www.vagueetvent.com/6,0,north,neo,kite,nue,2013-173528-40201.html
