La nouvelle Rally 2013 est composée de 5 lattes: 3 principales + 2 minis lattes. Le design des 3 lattes principales de l’Open Delta C de la Rally développe une puissance efficace et linéaire et offre une construction légère pour un maximum de stabilité en vol. 
