Aile.create(modele: 'Drifter', marque_id: 12, annee: 2014, note: 4, vote: '15', description: %Q[Nombreuses sont les fonctions qui font la renommée de la Drifter, la plus importante d'entre elles étant la 'drift stability' qui lui permet de se décaler sous le vent avec le rideur, même lorsque les lignes sont détendues. Dans les vagues, il est parfois nécessaire d'activer le depower de l'aile de façon à supprimer toute traction de l'aile et profiter de la puissance de la vague. Quand cette situation se présente, la Drifter est capable de rester en l'air et de descendre au vent avec le rideur. Au moment de border pour prendre de la puissance, l'aile réagit au quart de tour et reprend la traction... direction la prochaine vague !], score_relaunch: 8.0, score_highwind: 7.0, score_lowwind: 8.0, score_easyofuse: 9.0, score_wave: 10.0, score_unhooked: 7.0 ,url_flysurf: 'http://www.flysurf.com/ficheproduit-aile-cabrinha-drifter-2014-nue.htm?sectionid=25&productid=5667' ,url_vagueetvent: '' ,url_freerideattitude: 'http://www.freeride-attitude.com/cabrinha-drifter-2014,25880.html', tags: '4 lignes,Wave,Hybride', test_link: %Q[])
Aile.create(modele: 'Fuel', marque_id: 10, annee: 2013, note: 4, vote: '15', description: %Q[La Fuel est le C shape le plus performant et le choix des pro riders les plus engagés!! 

