Ce treizième cru ravira les rideurs recherchant une aile avec beaucoup de caractère. Au programme une aile très seine qui ne bouge pas en dehooké avec une grosse détente de ligne. Elle satisfera les adeptes du Freestyle wakestyle et permettra de 

progresser dans les passages de barre et les grabs unhooked. 

Elle pardonne les mouvements parasites de barres et bénéficie d’un excellent pop aile basse. 

Par ailleurs l’aile s’adresse aussi au rideurs désireux de sensations extrêmes en kiteloop, le coup pied est garantie sans pour autant tomber comme une pierre puisque le kite bénéficie d’une bonne ressource. 

Simplicité est aussi une caractéristique de ce kite qui est livré avec une barre 4 lignes adaptable aux autres ailes de la marque. Le redécollage n’en n’est pas sacrifié, il suffit de tirer sur un arriére et l’aile repart de suite.], score_relaunch: 6.0, score_highwind: 10.0, score_lowwind: 5.0, score_easyofuse: 7.0, score_wave: 8.0, score_unhooked: 10.0 ,url_flysurf: '' ,url_vagueetvent: '' ,url_freerideattitude: 'http://www.freeride-attitude.com/slingshot-fuel-2013,20893.html', tags: '4 lignes,Wakestyle,C-kite', test_link: %Q[])
Aile.create(modele: 'Vegas', marque_id: 3, annee: 2014, note: 4, vote: '18', description: %Q[La Vegas est un kite qui se passe d’introduction. 
Depuis des années, la Vegas est à la pointe du ride freestyle équipant les meilleurs riders mondiaux au sommet de leur art. Au cours des années, la Vegas a évolué et est aujourd’hui bien plus qu’un kite freestyle. 

Différentes options de réglages vous permettent de choisir entre les programmes Wakestyle, Freeride et, bien entendu Freestyle.
La voile possède le meilleur pop de toute la gamme North permettant d’atteindre une hauteur incroyable dans les tricks engagés. 
Une caractéristique unique du kite est ce retardateur de puissance après le pop de l’aile permettant au rider d’effectuer sa manoeuvre sans la traction du kite. 
Les kiteloops sur la Vegas sont précis et fiables, le kite tourne puissamment avec beaucoup de vitesse.
