Aile.create(modele: 'Park', marque_id: 1, annee: 2014, note: 5, vote: '17', description: %Q[La Park est l’aile polyvalente par excellence pour tous les types de conditions, tous les niveaux, et tous les styles. Conçue avec l’idée de plaisir avant tout, la Park est facile tout en ayant la puissance nécessaire pour sauter haut et une maniabilité excellente pour aller dans la vague avec style. La puissance dégagée par le profil offre au rider un excellent fond de puissance et une traction constante à travers une large plage de vent. Le diamètre des lattes a par ailleurs été réduit pour augmenter davantage le fond de puissance et pour diminuer le poids et réduire la traînée. L’outline Swept Compact C et le design 3 lattes permettent de conserver un profil extrêmement stable et maniable tout en permettant une variation d’incidence pour maximiser le dépower et le redécollage. Le nouveau bridage sans poulies augmente la remontée au vent, la relance en sortie de virages, la stabilité, la réactivité et les sensations en barre. Ce sont là toutes les caractéristiques essentielles pour la vague et le déhooké.
