Aile.create(modele: 'Bandit', marque_id: 2, annee: 2014, note: 5, vote: '17', description: %Q[Nous pouvons dire que cette année est l'année du changement chez Fone.
Tout d'abord, exit les numeros de version chez Fone, on parlera desormais de la Bandit 2014 !
Au niveau du team, le changement de designer, Robert GRAHAM à en effet rejoint Fone, apportant ainsi son experience du milieu du kite et du parapente, ainsi qu'un nouveau regard sur la fameuse bandit.
Ce changement dans le team signifie bien des changements au niveau de l'aile.
Si elle reste toujours avec la polyvalence legendaire qui lui est connue, de nombreux points de construction ont été revus, avec en premier lieu l'adoption du fameux TechnoForce D2 de Teijin, utilisé jusqu'alors uniquement sur les ailes North.
Ce spi à apporté non seulement une resistance toujours bienvenue quand on parle des nos ailes mais aussi  une deformation moindre du profil, procurant une meilleure stabilité au kite.
Cette stabilité procure une traction continue et sans a-coups dans la navigation tandis que les virages sont d'une fluidité exemplaire
