Elle  s'adresse aux riders à la recherchent d'une aile très performante, comme les riders intermédiaires qui veulent de la polyvalence et de l’accessibilité. 
En effet sur l'eau la nouvelle Rally 2012 est moins technique à piloter que l'année passée, que ce soit en Freeride, freestyle, race ou wave. 
Veritable Hybride entre C Shape et Delta Shape, la Rally redecollera facilement, vous amènera de la puissance en plage basse sans vous en donner l'impression, sera réactive ce qui permettra de créer facilement du vent aparent. 
La Slingshot Rally 2012 possède un bon hang-time ainsi qu'une grande plage d'utilisation, le tout associé avec la stabilité quasi parfaite du C Shape. 
La construction de la Rally permet d'offrir une meilleure durabilité et augmente la rigidité de l'aile. 
Son excellent depower réduit bien la puissance de la voile lorsque le vent prend des tours. 
La pression en barre est ajustable grace aux réglages des points d'attaches "Custom Fuel Injection".
